static void p_parse_error( _pcb* pcb )
{
	int		i;
	char**	vptr;
	char**	valid;
	char*	cur;

	if( !( vptr = valid =
			(char**)pmalloc( ( _act[ pcb->tos->state ][0] + 1 )
						* sizeof( char* ) ) ) )
		OUTOFMEM;

	for( i = 1; i < _act[ pcb->tos->state ][0] * 3; i += 3 )
		*( vptr++ ) = _symbols[ _act[ pcb->tos->state ][i] ].name;

	*vptr = (char*)NULL;

	if( pcb->sym == -1 )
		cur = pcb->lexem;
	else
		cur = _symbols[ pcb->sym ].name;

	p_error( parser, ERR_PARSE_ERROR,
				ERRSTYLE_FATAL | ERRSTYLE_FILEINFO,
					parser->filename, pcb->line, cur, valid );
}

int p_parse( PARSER* p, char* src )
{
	_pcb pcb;

	line = 1;
	auto_regex = 0;
	prec_cnt = 1;
	directive_level = 0;
	embedded_count = 0;
	memset( &pcb, 0, sizeof( pcb ) );

	if( p && src )
	{
		parser = p;
		strbuf_append( '\0' );

		src_ptr = src;

		_parse( &pcb );

		pfree( strbuf );
	}

	return pcb.error_count + error_count;
}



